<br>
<br>
<br>【全国一律送料無料】
<br>
<br>チューダーローズは、シェイクスピアの
<br>ロミオとジュリエットの時代に関わりがあり、
<br>“バラ戦争”の後、敵対勢力が遂に和解し、
<br>この徽章の下統一されたことから、
<br>イギリスの歴史上の黄金期を
<br>象徴するものとなっています。
<br>
<br>【サイズ】
<br>長さ:39mm
<br>幅:17mm
<br>重量:6g

