 <div class="leftphotobody">
  <div class="leftinformation"">
<center>
<br>鮮やかに装飾されたバラのモチーフは、
<br>華やかにエナメル加工が施され、
<br>バロック型パールは昔ながらの
<br>ランプワーク技法で手作りされています。
<br>
<br>複雑に加工が施されたエナメルのカラーは、
<br>白色部分が敵対していたヨーク家を、
<br>赤色部分がもう一方のランキャスター家を表し、
<br>デザインに取り込む事で
<br>両家の融合を象徴しています。
<br>この２つの名家の間に生まれた絆がまた、
<br>キャプレット家とモンタギュー家が
<br>築けなかったものの象徴にもなっています。
